const Home = () => {
  return (
    <div className="container mt-5">
      <h1>Welcome to Education Management System</h1>
      <p>Your one-stop solution for educational institution management</p>
      <div className="row mt-4">
        <div className="col-md-4">
          <h3>For Students</h3>
          <p>Access your courses, assignments, and track your progress</p>
        </div>
        <div className="col-md-4">
          <h3>For Teachers</h3>
          <p>Manage courses, students, and assignments efficiently</p>
        </div>
        <div className="col-md-4">
          <h3>For Administration</h3>
          <p>Overview of institution performance and management tools</p>
        </div>
      </div>
    </div>
  );
};

export default Home;
